import React from 'react';
import { BrowserRouter } from 'react-router-dom';
import { useRoutes } from 'react-router-dom'; // Assicurati di usare il modulo corretto

import StartScreen from './components/StartScreen';
import Quiz from './components/Quiz';

// Definisci le tue rotte usando l'hook useRoutes all'interno di un BrowserRouter
function App() {
  const routes = useRoutes([
    { path: '/', element: <StartScreen /> },
    { path: '/quiz', element: <Quiz /> },
    // ... altre rotte
  ]);

  return <BrowserRouter>{routes}</BrowserRouter>; // Rendi le rotte all'interno di BrowserRouter
}

export default App;
